{"1": {"comment_id": "_limitech"  "comment_text": "Limitech’s MyMix cleaned and ready for next trial run! This week we are making Hummus 🥄🥣

Hummus historically originated from the middle east and was a very popular dip and spread. Both then and today  Hummus is packed with vitamins and Minerals mostly consisting of chickpea purée mixed with different complementary ingredients. The Word Hummus means chickpea in Arabic. However  today several different countries have their own twist of the recipe.

#hummus #limitech #hommus #hoummous #hoummus #chickpea #mousse #puree #purée"}}

